import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="App-header">
        <h5>League of Legends Player Search</h5>
      </div>
      <div className="App-content">
        <div className="App-search-box">
          <input type="text" className="App-search-box-text"></input>
          <button className="App-search-box-button"></button>
        </div>
      </div>
    </div>
  );
}

export default App;
